import Logo from './logo.svg';

const Nav = ()=>{
    return(
        <div className="navbar">
            <div className="logo">
                <img src={Logo} alt="" srcset="" />
            </div>
            <div className="ham"></div>
        </div>
    );
}

export default Nav;
